import React, { Component } from 'react';

export default class Footer extends Component{

    render(){
        return (
            <div id="Footer" className="footer">
                <div className="footer-container w-container">
                    <div className="footer-wrapper-top">
                        <a href="/" className="hood-food-guide-link w-inline-block w--current">
                            <img src="https://uploads-ssl.webflow.com/5c68aa0a46b367677ef35fd6/5c6a127446b367b210f4e447_Hood-grey-2.png" width="160" height="44" alt="" className="hood-food-guide-logo"/>
                        </a>
                        <a href="/privacy" className="link">Privacy</a>
                        <a href="/terms" className="link">Terms</a>
                        <a href="/about" className="link">About Hood Food Guide</a>
                        <a href="mailto:contact@hoodfoodguide.com" className="link">Contact</a>
                        <div className="text-block">Â© 2019 Hood Food Guide</div>
                    </div>
                </div>
            </div>
        );
    }
}
